import React from "react";
function Twitter (){
    const [showDropdown, setShowDropdown] = useState(false);

    const handleClick = () => {
      setShowDropdown(!showDropdown);
    };

    return (
        <div onClick={handleClick} style={{ width: '200px', height: '100px', border: '1px solid black' }}>
        Rectangle Card
        {showDropdown && (
          <ul>
            <li>Option 1</li>
            <li>Option 2</li>
            <li>Option 3</li>
          </ul>
        )}
      </div>
    )
}

export default Twitter;
